import React, { Component } from 'react';
import { Paper, Container, Grid, Typography, Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme: any) => ({
    postBlock: {
        positon: "relative",
        color: theme.palette.color.white
    },
    postContent: {

    }
}))

type StartPostProps = {
    classes: any
}

class StartPost extends Component<StartPostProps>
{
    render()
    {
        const classes = this.props.classes;

        return(
            <Paper className={classes.postBlock} style={{backgroundImage:'url(https://source.unsplash.com/random)'}}>
                <Container fixed>
                    <Grid container>
                        <Grid item md={6}>
                            <div>
                                <Typography component="h1" 
                                color="inherit" 
                                gutterBottom>
                                    Expense Tracker Web Application
                                </Typography>
                                <Typography component="h5" 
                                color="inherit" paragraph>
                                    Expense Tracker Web Application
                                    fsdafdsf sadf ds fdsasdaf sda fsda 
                                    fdsfsad sadf sdaf sdaf dsa sdaf
                                </Typography>
                                <Button variant="contained" color="secondary">
                                    Try It Free
                                </Button>
                            </div>
                        </Grid>
                    </Grid>
                </Container>
            </Paper>
        );
    }
}

export default () => {
    const classes = useStyles();
    return <StartPost classes={classes} />
};
